    private Object getEntityKey(Customerinfo entity) {
    	return entity.getCustomerid();
    }

    @Test
    public void testPersistFindRemove() {
    	
    	Customerinfo entity = createEntity();
    	Object key = getEntityKey(entity);

    	// if entity doesn't exist yet
    	if ( find(Customerinfo.class, key) == null ) {

	    	// Create with 'persist'
    		persistAndRefresh(entity);
    	
			// Find
			Customerinfo entity2 = find(Customerinfo.class, key);
			assertNotNull(entity2);
        
			// Remove
			remove(entity2);
			assertNull(find(Customerinfo.class, key));
		}
    }
    
    @Test
    public void testMergeFindRemove() {
    	
    	Customerinfo entity = createEntity();
    	Object key = getEntityKey(entity);

    	// Create or update with 'merge'
    	mergeAndRefresh(entity);
    	
    	// Find
    	Customerinfo entity2 = find(Customerinfo.class, key);
        assertNotNull(entity2);
        
    	// Remove
    	remove(entity2);
        assertNull(find(Customerinfo.class, key));
    }

